var tipuesearch = {"pages": [{'title': '計算機程式', 'text': '倉儲:\xa0 https://github.com/40823201/cp2019 \n 課程網頁: http://mde.tw/cp2019/content/index.html \n Gist: https://gist.github.com/40823201/d9f7bc5daa98a11de2e1fd3c02a469d9 \n Dartpad: https://dartpad.dartlang.org/?id=d9f7bc5daa98a11de2e1fd3c02a469d9 \n \n  取 Dart 程式的按鈕  \n 放大   回復   Hello   For Loop   Mass_Spring_Damping \n  內建放入的 Dart 原始碼  \n \n', 'tags': '', 'url': '計算機程式.html'}, {'title': 'Work', 'text': '', 'tags': '', 'url': 'Work.html'}, {'title': '上課作業', 'text': '\n 原始碼 \n void main() {\n    print("喔耶");\n} \n \n 原始碼 \n int i;\nint sum;\n\nmain(){\n  sum = 0;\n  for(i=1;i <= 10 ;i++){\n    sum += i;\n    print("$sum");\n  }\n  print(\'sum = $sum\');\n} \n \n 原始碼 \n rungeKutta(t0, x0, t, h) {\n  int n = ((t - t0) / h).toInt();\n  double x = x0;\n  for (int i = 1; i <= n; i++) {\n    double k1 = h * dxdt(t0, x);\n    double k2 = h * dxdt(t0 + 0.5 * h, x + 0.5 * k1);\n    double k3 = h * dxdt(t0 + 0.5 * h, x + 0.5 * k2);\n    double k4 = h * dxdt(t0 + h, x + k3);\n    x = x + (1.0 / 6.0) * (k1 + 2 * k2 + 2 * k3 + k4);\n    t0 = t0 + h;\n  }\n  return x;\n}\n\ndxdt(t, x) {\n  return ((t - x) / 2);\n}\n\nmain() {\n  num t0 = 0;\n  num x = 1;\n  num t = 2;\n  double h = 0.2;\n  print(\'The value of x at t=$t is: ${rungeKutta(t0, x, t, h)}\');\n}\n \n \n', 'tags': '', 'url': '上課作業.html'}, {'title': '上課筆記', 'text': '', 'tags': '', 'url': '上課筆記.html'}]};